import React from "react";
import Navbar from "../Components/Navbar";


const BACKEND = "http://localhost:4000/login"

async function submit(e) {
    e.preventDefault()
    const res = await fetch(BACKEND, {
        method: "POST",
        headers: {
            'Content-Type': 'application/json',
          },
        body: JSON.stringify({
            "email": e.target.femail.value,
            "password": e.target.fpassword.value
        })
    })
    console.log(res)

}

export default function SignUp() {
   return (
    <div>
    <h2>Sign Up</h2>
    <form onSubmit = {submit}>
        <label htmlFor="femail">Email:</label>
        <input 
            type="text" 
            id="femail" 
            name="femail" 
        />
        <label htmlFor="fpassword">Password:</label>
        <input 
            type="text" 
            id="fpassword" 
            name="fpassword"
        />
        <label htmlFor="fconfirmpassword">Confirm Password:</label>
        <input 
            type="text" 
            id="fconfirmpassword" 
            name="fconfirmpassword" 
        />
        <button type="submit">Sign Up</button> 
    </form>
  </div>
   ) 

   // check if its valid on the page
   // if it is, send it off
}
